/*Table structure for table `master_team` */

DROP TABLE IF EXISTS `master_team`;

CREATE TABLE `master_team` (
  `id` bigint(21) NOT NULL AUTO_INCREMENT,
  `uid` varchar(14) DEFAULT NULL,
  `name` varchar(140) DEFAULT NULL,
  `founded` varchar(4) DEFAULT NULL,
  `symid` varchar(10) DEFAULT NULL,
  `stadium_id` varchar(12) DEFAULT NULL,
  `stadium_capacity` int(7) DEFAULT NULL,
  `stadium_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_UID` (`uid`),
  UNIQUE KEY `IDX_SYMID` (`symid`),
  KEY `stadium_id` (`stadium_id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

